import React from 'react';
export default function Terms() {
  return (
    <div className="page-content">
      <h2>Terms & Conditions</h2>
      <p>
        By using this app, you agree to follow our terms related to data usage,
        consultation limitations, and responsible use of health suggestions. All content is informational only.
      </p>
    </div>
  );
}
